style.css:
@-moz-document url("http://frenzy.sparklinlabs.com/") {

 canvas {
      -webkit-animation-duration: 360s;
      -webkit-animation-name: demancia;
      -webkit-animation-iteration-count: infinite;
      -moz-animation-duration: 360s;
      -moz-animation-name: demancia;
      -moz-animation-iteration-count: infinite;
    }
    
    @-webkit-keyframes demancia {
      from {
	  -webkit-transform:rotate(-5deg);
      }
      
      to {
	    -webkit-transform:rotate(360deg);
      }
    }
    @-moz-keyframes demancia {
      from {
	  -webkit-transform:rotate(-5deg);
      }
      
      to {
	    -webkit-transform:rotate(360deg);
      }
    }
}
